ScriptAction.script:
importPackage(net.ipsoft.ipcenter.framework.velocity);
function setVar (name, value) {
    execution.getExecutionVariableForScope(name, executionPointer.getCurrentScope()).setValue(value);
}

/* ================================================== */
/* Up interfaces description check */
if ( devhostname1.match(/^DC|^CS|^CR/gi) ) {
setVar('int_desc_chk','PASS');
}
else {
 if ( ! int_desc_out.match(/\w+/gi) ) {
  setVar('int_desc_chk','PASS');
 }
}
/* ================================================== */

/* Down interfaces description check */
if ( devhostname1.match(/^DC|^CS|^CR/gi) ) {
setVar('int_down_chk','PASS');
}
else {
     if ( ! int_down_out.match(/\w+/gi) ) {
setVar('int_down_chk','PASS');
}
}
/* ================================================== */

/* Secret Password check */
if ( secret_out.match(/enable secret/gi) ) {
setVar('secret_chk','PASS');
}

/* ================================================== */

/* HTTP check */
if ( http_out.match(/no/gi) ) {
setVar('http_chk','PASS');
}

/* ================================================== */

/* BootP check */
if ( bootp_out.match(/no/gi) ) {
setVar('bootp_chk','PASS');
}

/* ================================================== */

/* Source Route check */
if ( srcrt_out.match(/no/gi) ) {
setVar('srcrt_chk','PASS');
}

/* ================================================== */

/* Logging check */
if ( lgg_out.match(/\d+\.\d+\.\d+\.\d+/gi) ) {
setVar('lgg_chk','PASS');
}

/* ================================================== */

/* Logging Buffer check */
if ( lgbfr_out.match(/.*/gi) ) {
setVar('lgbfr_chk','PASS');
}

/* ================================================== */

/* TCP keep alive check */
if ( tcp_out.match(/no/gi) ) {
setVar('tcp_chk','PASS');
}

/* ================================================== */

/* Encryption check */
if ( encry_out.match(/service password-encryption/gi) ) {
setVar('encry_chk','PASS');
}

/* ================================================== */

/* Time stamp check */
if ( tmst_out.match(/no/gi) ) {
setVar('tmst_chk','FAIL');
}

/* ================================================== */

/* AAA check */
if (aaa_out.match(/aaa authentication login vty group tacacs\+ local/gi) && aaa_out.match(/aaa authentication login con none/gi) && aaa_out.match(/aaa authorization exec vty group tacacs\+ local/gi) && aaa_out.match(/aaa authorization exec con none/gi) && aaa_out.match(/aaa authorization commands 1 vty group tacacs\+ local/gi) && aaa_out.match(/aaa authorization commands 15 vty group tacacs\+ local if\-authenticated/gi) && aaa_out.match(/aaa accounting exec vty start\-stop group tacacs\+/gi)  && aaa_out.match(/aaa accounting commands 1 vty start\-stop group tacacs\+/gi)  && aaa_out.match(/aaa accounting commands 15 vty start\-stop group tacacs\+/gi)  && aaa_out.match(/aaa session\-id common/gi))
{
setVar('aaa_chk','PASS');
}

/* ================================================== */

/* Tacacs server host check */
if ( tcsrv_out.match(/\w+/gi) ) {
setVar('tcsrv_chk','PASS');
}

/* ================================================== */

/* User check */
if ( usr_out1.match(/Indosat privilege 15 secret/gi) && ! usr_out2.match(/\w+/gi) )
{
setVar('usr_chk','PASS');
}

/* ================================================== */

/* Pwd minlen check */
if ( minlen_out.match(/no/gi) ) {
setVar('minlen_chk','PASS');
}

/* ================================================== */

/* SNMP RW check */
if ( snmprw_out1.match(/\s+RW\s+/gi) && ! snmprw_out2.match(/\w+/gi) )
{
setVar('snmprw_chk','PASS');
}

/* ================================================== */

/* Banner - MOTD check */
if ( motd_out.match(/banner motd/gi) && motd_out.match(/UNAUTHORIZED ACCESS STRICTLY FORBIDDEN/gi) && motd_out.match(/not authorized/gi) && motd_out.match(/Disconnect immediately/gi) && motd_out.match(/Violators/gi) && motd_out.match(/prosecuted/gi) && motd_out.match(/Civil/gi) && motd_out.match(/Criminal law/gi))
{
setVar('motd_chk','PASS');
}

/* ================================================== */

/* SNMP RO Check */
var snmpro_out_len = snmpro_out1;
snmpro_out_len = snmpro_out_len.replace('snmp-server community (miyamoto|mushashi|brabus|isat-wips) ','');
snmpro_out_len = snmpro_out_len.replace(' RO (1|5)','');
var snmpro_len = snmpro_out_len.length;
snmpro_len;

if ( snmpro_out1.match(/\w+/gi) && ! snmpro_out2.match(/\s+RW/g))
{
setVar('snmpro_chk','PASS');
}

/* ================================================== */

/* ACL 15 check */
if ( acl15_out.match(/permit/gi) )
{
setVar('acl15_chk','FAIL');
}

/* ================================================== */

/* NTP check */
if ( ntp_out.match(/no|sync/gi) ) {
setVar('ntp_chk','PASS');
}

/* ================================================== */

/* Line console check */
if ( ! lincon_out.match(/no/gi) ) {
setVar('lincon_chk','FAIL');
}

/* ================================================== */

/* Line AUX check */
if ( linaux_out.match(/line aux 0/gi) || linaux_out.match(/stopbits 1/gi) ) {
setVar('linaux_chk','PASS');
}

/* ================================================== */

/* Line VTY check */
if ( linvty1_out.match(/line vty 0 4\s*\n.*\s*privilege level 15/gi) ) {
setVar('linvty_chk','PASS');
}

/* ================================================== */

/* ACL 38 check */
if ( ! acl38_out.match(/no/gi) ) {
setVar('acl38_chk','FAIL');
}

/* ================================================== */
/* The end */
/* SHC output for storage */
var a = int_desc_all + "\n\n" + int_desc_down + "\n\n" + en_sec_all + "\n\n" + iphttp_all + "\n\n" + ipbootp_all + "\n\n" + ipsrc_all + "\n\n" + logg_all + "\n\n" + loggbuffer_all + "\n\n" + tcpkeep_all + "\n\n" + srcpwd_all + "\n\n" + timestamp_all + "\n\n" + secaaa_all + "\n\n" + serhost_all + "\n\n" + usr_all + "\n\n" + secpwd_all + "\n\n" + snmp_all + "\n\n" + motd_all + "\n\n" + snmpro_all + "\n\n" + acl_all + "\n\n" + ntpass_all + "\n\n" + lincon_all + "\n\n" + linaux_all + "\n\n" + linvty_all + "\n\n" + acl38_all;
setVar('shc_output',a);

/* Final output */
var component_output='<tr><td>' + affected_host + '</td><td>' + int_desc_chk + '</td><td>' + int_down_chk + '</td><td>' + secret_chk + '</td><td>' + http_chk + '</td><td>' + bootp_chk + '</td><td>' + srcrt_chk + '</td><td>' + lgg_chk + '</td><td>' + lgbfr_chk + '</td><td>' + tcp_chk + '</td><td>' + encry_chk + '</td><td>' + tmst_chk + '</td><td>' + aaa_chk + '</td><td>' + tcsrv_chk + '</td><td>' + usr_chk + '</td><td>' + minlen_chk + '</td><td>' + snmprw_chk + '</td><td>' + motd_chk + '</td><td>' + snmpro_chk + '</td><td>' + acl15_chk + '</td><td>' + ntp_chk + '</td><td>' + lincon_chk + '</td><td>' + linaux_chk + '</td><td>' + linvty_chk + '</td><td>' + acl38_chk + '</td></tr>';
